import React from 'react';
import { useSelector } from 'react-redux';
import AppLayout from '../../components/AppLayout'

function MovieInfo () {
    const { src, name, genre, rating, repRlsDate, runtime } = useSelector(state => state.movie);

    return (
        <AppLayout>
            {name}
            {genre}
        </AppLayout>
    )
}

export default MovieInfo;
